import Panel from "./Components/Panel";
import {panelData} from "./data/home_data";
import "./Home.css";

function Home() {
    const panels = panelData.map(item => {
        return (
            <div className="home_panel" key={item.title}>
                <Panel title={item.title} imgSrc={item.imgSrc} imgAlt={item.imgAlt} text={item.text} dir={"right"}/>
            </div>
        )
    })
    return (
        <div className="home__main">
            {panels}
        </div>
    )
}

export default Home;
